! function (o, s, e) {
    console.log("init");
    var n = {
        init: function (e) {
            n.select2(), n.carousel(), n.stellar(), n.dateTimePicker(), n.sideNav()
        },
        select2: function () {
            o(e).ready(function () {
                o("#selectPerson").select2({
                    placeholder: "Person",
                    allowClear: !0
                })
            })
        },
        carousel: function () {
            o(".hero-carousel").owlCarousel({
                loop: !0,
                margin: 10,
                nav: !0,
                dots: !1,
                responsive: {
                    0: {
                        items: 1
                    },
                    600: {
                        items: 1
                    }
                },
                nav: !0,
                navText: ['<span class="lnr lnr-chevron-left"></span>', '<span class="lnr lnr-chevron-right"></span>']
            }), o(".testi-carousel").owlCarousel({
                loop: !0,
                margin: 10,
                autoplay: !0,
                nav: !1,
                dots: !0,
                dotSpeed: 1e3,
                autoplay: !0,
                autoplaySpeed: 1e3,
                items: 1
            })
        },
        stellar: function () {
            var e = o(s).width();
            767 <= e && (o(".bg-fixed").attr("data-stellar-background-ratio", "0.8"), o.stellar({
                horizontalScrolling: !1,
                responsive: !0,
                parallaxBackgrounds: !0,
                scrollProperty: "scroll"
            }))
        },
        dateTimePicker: function () {
            o("#datetimepicker4").datetimepicker({
                format: "L"
            }), o("#datetimepicker3").datetimepicker({
                format: "LT"
            })
        }
    };
    o(e).ready(function () {
        n.init(o)
    })
}(window.jQuery, window, document);